import React from 'react';
import ReactDOM from 'react-dom';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import Card from './components/Card';
import './App.css';

function App() {
  return (
    <div className="App">
        <Navbar />
        <Hero />
        <Card />
    </div>
  );
}

export default App;
